(1, 68, 'Главная', 'glavnaya', '<h1>Производство и продажа кирпича в&nbsp;Алтайском крае</h1>\r\n<p>Мы предлагаем кирпичи марок М100 и М125, которые помогут вам успешно реализовать любой строительный проект. Наши кирпичи отвечают самым высоким стандартам качества.</p>\r\n<div class=\"prodwrap\">\r\n<div class=\"prodwrap3\">\r\n<div class=\"prod\"><a href=\"brickm100.html\">\r\n<div class=\"prod_vn\">\r\n<div class=\"prodimg\">\r\n<p><img src=\"images/main/img01.png\" alt=\"\" /></p>\r\n</div>\r\n<h2>Кирпич М100</h2>\r\n<p class=\"desc\">Кирпичи марки М100 выдерживаютт нагрузку<br>до 100 кг/см²</p>\r\n</div>\r\n</a></div>\r\n<div class=\"prod\"><a href=\"brickm125.html\">\r\n<div class=\"prod_vn\">\r\n<div class=\"prodimg\">\r\n<p><img src=\"images/main/img01.png\" alt=\"\" /></p>\r\n</div>\r\n<h2>Кирпич М125</h2>\r\n<p class=\"desc\">Кирпичи марки М125 выдерживаютт нагрузку<br>до 125 кг/см²</p>\r\n</div>\r\n</a></div>\r\n</div>\r\n</div>', '', 1, 2, '2022-06-10 04:31:16', 98, '', '2025-10-28 04:00:14', 98, 98, '2025-10-31 09:33:47', '2022-06-10 04:31:16', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"show_article_options\":\"\",\"show_urls_images_backend\":\"\",\"show_urls_images_frontend\":\"\"}', 76, 8, '', '', 1, 0, '{\"robots\":\"\",\"author\":\"\",\"rights\":\"\",\"xreference\":\"\"}', 0, '*', '', ''),
(27, 155, 'Производство и продажа кирпича М100', 'brickm100', '<p>Наши кирпичи изготавливаются из высококачественных материалов, что гарантирует их прочность и долговечность.</p>\r\n<div class=\"maincontent\">\r\n<div class=\"content-left\">\r\n<div class=\"content-leftvn\">\r\n<h2>Мы предлагаем</h2>\r\n<p><a href=\"#em100\" class=\"menus\">Кирпич М100</a></p>\r\n<p><a href=\"brickm125.html\" class=\"menus\">Кирпич М125</a></p>\r\n<h3>Контакты для заказа</h3>\r\n<div class=\"twa\">\r\n<p><a href=\"https://api.whatsapp.com/send/?phone=79236474033\" title=\"WhatsApp\"><i class=\"fa fa-whatsapp\" aria-hidden=\"true\"></i>WhatsApp</a></p>\r\n</div>\r\n<div class=\"twa twa2\">\r\n<p><a href=\"mailto:oookup@bk.ru\"><i class=\"fa fa-envelope-o\" aria-hidden=\"true\"></i>oookup@bk.ru</a></p>\r\n</div>\r\n<div class=\"twatel\">\r\n<p><a href=\"tel:+79039923585\"><span>+7-923-647-4033</span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"content-right\">\r\n<div class=\"content-rightvn\">\r\n<div id=\"em100\" class=\"descrip\">\r\n<div class=\"descripimg\"><img src=\"images/main/img01.png\" alt=\"\" /></div>\r\n<div class=\"descriptxt\">\r\n<h2>Кирпич М100</h2>\r\n<p style=\"font-weight: 600;\">Основные преимущества:</p>\r\n<ul>\r\n<li>низкая цена кирпича М100</li>\r\n<li>большая прочность и долговечность</li>\r\n<li>универсальное применение</li>\r\n<li>экологическая безопасность</li>\r\n</ul>\r\n<p><img src=\"images/ico/pdf.svg\" alt=\"\" style=\"vertical-align: sub; width: 20px;\" /> <a href=\"images/doc/protocol.pdf\" target=\"_blank\">Протокол испытаний</a></p>\r\n<p class=\"cena\">Цена: <span style=\"color: #c90508;\"><span style=\"font-size: 34px;\">15</span>.00</span> руб. за&nbsp;штуку</p>\r\n<p class=\"grey\">работаем без НДС</p>\r\n</div>\r\n</div>\r\n<div class=\"clear\" style=\"margin-top: 20px;\">&nbsp;</div>\r\n<p>Кирпич M100 – один из самых востребованных видов кирпича. Он широко используется в строительстве благодаря универсальности применения. Он может быть использован для возведения несущих стен и внутренних перегородок, арок и других конструкций.</p>\r\n<p><strong>ООО «ТДРКЗ»</strong> выпускает несколько видов кирпича, и производство и продажа кирпича М100 – одно из основных направлений нашей деятельности. Этот кирпич пользуется большим спросом в нашем регионе. Он устойчив к воздействию морозов, благодаря малому проценту пустот в него слабо проникает влага.</p>\r\n<p>Невысокая цена на кирпич М100 окупается многократно благодаря его удивительной долговечности. Этот вид кирпича прекрасно переносит нагрузки на сжатие и сохраняет свои качества в течение десятилетий, если не столетий. Как правило, даже после демонтажа зданий кирпич этой марки может использоваться повторно.</p>\r\n<div class=\"gallery\"><a href=\"/images/kirpich/100-1.jpg\" data-fancybox=\"images\"> <img src=\"/images/kirpich/100-1.jpg\" alt=\"\" /> </a> <a href=\"/images/kirpich/100-2.jpg\" data-fancybox=\"images\"> <img src=\"/images/kirpich/100-2.jpg\" alt=\"\" /> </a> <a href=\"/images/kirpich/km100_01.JPG\" data-fancybox=\"images\"> <img src=\"/images/kirpich/km100_01.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/km100_02.JPG\" data-fancybox=\"images\"> <img src=\"/images/kirpich/km100_02.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/100_01.JPG\" data-fancybox=\"images\"> <img src=\"/images/kirpich/100_01.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/100_02.JPG\" data-fancybox=\"images\"> <img src=\"/images/kirpich/100_02.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/100_03.JPG\" data-fancybox=\"images\"> <img src=\"/images/kirpich/100_03.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/100_04.JPG\" data-fancybox=\"images\"> <img src=\"/images/kirpich/100_04.JPG\" alt=\"\" /> </a></div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 2, '2025-10-21 08:47:06', 98, '', '2025-10-28 03:57:03', 98, 0, '0000-00-00 00:00:00', '2025-10-21 08:47:06', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_in