(33, 173, 'Производство и продажа кирпича М125', 'brickm125', '<p>Наши кирпичи изготавливаются из высококачественных материалов, что гарантирует их прочность и долговечность.</p>\r\n<div class=\"maincontent\">\r\n<div class=\"content-left\">\r\n<div class=\"content-leftvn\">\r\n<h2>Мы предлагаем</h2>\r\n<p><a href=\"brickm100.html\" class=\"menus\">Кирпич М100</a></p>\r\n<p><a href=\"#em125\" class=\"menus\">Кирпич М125</a></p>\r\n<h3>Контакты для заказа</h3>\r\n<div class=\"twa\">\r\n<p><a href=\"https://api.whatsapp.com/send/?phone=79236474033\" title=\"WhatsApp\"><i class=\"fa fa-whatsapp\" aria-hidden=\"true\"></i>WhatsApp</a></p>\r\n</div>\r\n<div class=\"twa twa2\">\r\n<p><a href=\"mailto:oookup@bk.ru\"><i class=\"fa fa-envelope-o\" aria-hidden=\"true\"></i>oookup@bk.ru</a></p>\r\n</div>\r\n<div class=\"twatel\">\r\n<p><a href=\"tel:+79039923585\"><span>+7-923-647-4033</span></a></p>\r\n</div>\r\n</div>\r\n</div>\r\n<div class=\"content-right\">\r\n<div class=\"content-rightvn\">\r\n<div id=\"em125\" class=\"descrip\">\r\n<div class=\"descripimg\"><img src=\"images/main/img01.png\" alt=\"\" /></div>\r\n<div class=\"descriptxt\">\r\n<h2>Кирпич М125</h2>\r\n<p style=\"font-weight: 600;\">Основные преимущества:</p>\r\n<ul>\r\n<li>является керамическим</li>\r\n<li>способен выдержать 125 килограмм на квадратный сантиметр поверхности</li>\r\n<li>кирпич М125 долговечен</li>\r\n<li>имеет сравнительно низкую стоимость</li>\r\n</ul>\r\n<p><img src=\"images/ico/pdf.svg\" alt=\"\" style=\"vertical-align: sub; width: 20px;\" /> <a href=\"images/doc/protocol.pdf\" target=\"_blank\">Протокол испытаний</a></p>\r\n<p class=\"cena\">Цена: <span style=\"color: #c90508;\"><span style=\"font-size: 34px;\">15</span>.50</span> руб. за&nbsp;штуку</p>\r\n<p class=\"grey\">работаем без НДС</p>\r\n</div>\r\n</div>\r\n<div class=\"clear\" style=\"margin-top: 20px;\">&nbsp;</div>\r\n<p>Именно цена на кирпич М125 привлекает покупателей, ведь в сравнении с другими вариантами, купить данный материал гораздо выгоднее при схожих сравнительных характеристиках. Также он соответствует всем действующим стандартам, поэтому вы можете не сомневаться в его качестве.</p>\r\n<p>Продажа кирпича М125 осуществляется оптом и в розницу. Вы сможете также присмотреть и другие материалы, необходимые для строительства, на нашем сайте.</p>\r\n<p>Мы стараемся предложить нашим клиентам все самое наилучшее, и будем рады, если вы закажете кирпич М125 у нас!</p>\r\n<div class=\"gallery\"><a href=\"/images/kirpich/km125_01.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/km125_01.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/km125_02.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/km125_02.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_01.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_01.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_02.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_02.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_03.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_03.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_04.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_04.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_05.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_05.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_06.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_06.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_07.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_07.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_08.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_08.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_09.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_09.JPG\" alt=\"\" /> </a> <a href=\"/images/kirpich/125_10.JPG\" data-fancybox=\"images2\"> <img src=\"/images/kirpich/125_10.JPG\" alt=\"\" /> </a></div>\r\n</div>\r\n</div>\r\n</div>'