(34, 174, 'Торговый Дом Ребрихинский Кирпичный Завод', 'abtzavod', '<p>Наш завод начал работу в 2003 году. На тот момент мощность завода составляла 10 млн шт. кирпича в год.</p>\r\n<p><br />В 2010 году после реконструкции кольцевой печи завод стал выпускать 20 млн кирпичей в год.</p>\r\n<p><br />В 2017 году началось строительство второй очереди, которое завершилось в марте 2018 года. В результате наш кирпичный завод стал одним из крупных производителей и лидеров по ассортименту и качеству полнотелого кирпича в Алтайском крае.</p>\r\n<p><br />На данный момент мы продолжаем реконструкцию оборудования и проводим автоматизацию процессов.</p>\r\n<p><br />Каждый наш кирпич - это не просто строительный материал, это часть истории, часть нашей страсти к созданию надежных и прочных зданий.</p>', '', 1, 2, '2025-10-24 04:59:21', 98, '', '2025-10-28 04:09:12', 98, 98, '2025-10-31 09:33:18', '2025-10-24 04:59:21', '0000-00-00 00:00:00', '{\"image_intro\":\"\",\"float_intro\":\"\",\"image_intro_alt\":\"\",\"image_intro_caption\":\"\",\"image_fulltext\":\"\",\"float_fulltext\":\"\",\"image_fulltext_alt\":\"\",\"image_fulltext_caption\":\"\"}', '{\"urla\":false,\"urlatext\":\"\",\"targeta\":\"\",\"urlb\":false,\"urlbtext\":\"\",\"targetb\":\"\",\"urlc\":false,\"urlctext\":\"\",\"targetc\":\"\"}', '{\"article_layout\":\"\",\"show_title\":\"\",\"link_titles\":\"\",\"show_tags\":\"\",\"show_intro\":\"\",\"info_block_position\":\"\",\"info_block_show_title\":\"\",\"show_category\":\"\",\"link_category\":\"\",\"show_parent_category\":\"\",\"link_parent_category\":\"\",\"show_associations\":\"\",\"show_author\":\"\",\"link_author\":\"\",\"show_create_date\":\"\",\"show_modify_date\":\"\",\"show_publish_date\":\"\",\"show_item_navigation\":\"\",\"show_icons\":\"\",\"show_print_icon\":\"\",\"show_email_icon\":\"\",\"show_vote\":\"\",\"show_hits\":\"\",\"show_noauth\":\"\",\"urls_position\":\"\",\"alternative_readmore\":\"\",\"article_page_title\":\"\",\"show_publishing_options\":\"\",\"sh