(95, 89, 'Баннер главная', '', '<h1>Тигровый орех</h1>\r\n\r\n<p class=\"green\">Новинка на ореховом рынке России, еще ни в одном магазине, ни у одного ритейлера на прилавках нет такого супер продукта.</p>\r\n\r\n\r\n<p class=\"grey\">Имеется протокол испытания качества и безопасности государственных лабораторий!</p>\r\n\r\n\r\n<p><a href=\"https://api.whatsapp.com/send/?phone=79001894912\" class=\"more\" target=\"_blank\"><img src=\"/images/message.svg\" alt=\"\" />Консультация в WhatsApp</a></p>', 1, 'promo', 0, '0000-00-00 00:00:00', '2025-03-13 02:45:53', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(96, 90, 'Цены Spa-процедуры и программы все (главная)', '', '<h2>SPA-программы</h2>\r\n<div class=\"sa3 sa301\" style=\"position: relative;\">\r\n<p><img src=\"images/spa/spa_0001.jpg\" alt=\"\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3>SPA Алтайское золото</h3>\r\n<p class=\"min\">Распаривание в кедровой арома-сауне (корень солодки, золотой корень, смородина, чабрец)</p>\r\n<p class=\"min\">Медово-солевой пилинг</p>\r\n<p class=\"min\">Массаж Абхьянга (умасливание тела)</p>\r\n<p class=\"min\">Обёртывание с целебными травам в молоке</p>\r\n<p class=\"min\">Чаепитие с Алтайскими травами и натуральным медом</p>\r\n<p class=\"min\">&nbsp;</p>\r\n<p class=\"min\">Время: 3 часа</p>\r\n<p class=\"cena\">5 700 ₽</p>\r\n<p><a href=\"#zak-kup\" class=\"more modalbox\">Записаться</a></p>\r\n</div>\r\n<p class=\"firm\">Фирменная программа</p>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><img src=\"images/spa/spa_0002.jpg\" alt=\"\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3>SPA Аромат леса</h3>\r\n<p class=\"min\">Распаривание в кедровой арома-сауне с сбором Алтайских трав (хвоя, хмель, пустырник и т.д)</p>\r\n<p class=\"min\">Пилинг тела с кедровым жмыхом и маслом</p>\r\n<p class=\"min\">Расслабляющий авторский массаж</p>\r\n<p class=\"min\">Чаепитие с Алтайскими травами и натуральным медом</p>\r\n<p class=\"min\">&nbsp;</p>\r\n<p class=\"min none\">&nbsp;</p>\r\n<p class=\"min\">Время: 2 часа</p>\r\n<p class=\"cena\">5 500 ₽</p>\r\n<p><a href=\"#zak-kup\" class=\"more modalbox\">Записаться</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><img src=\"images/spa/spa_0003.jpg\" alt=\"\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3>SPA Таежное</h3>\r\n<p class=\"min\">Распаривание в арома-сауне с травяным сбором (зверобой, береза, бессмертник и т.д)</p>\r\n<p class=\"min\">Массаж спины с кедровым маслом</p>\r\n<p class=\"min\">Чаепитие с Алтайскими травами и натуральным медом</p>\r\n<p class=\"min\">&nbsp;</p>\r\n<p class=\"min none\">&nbsp;</p>\r\n<p class=\"min none\">&nbsp;</p>\r\n<p class=\"min\">Время: 1 час 40 минут</p>\r\n<p class=\"cena\">3 800 ₽</p>\r\n<p><a href=\"#zak-kup\" class=\"more modalbox\">Записаться</a></p>\r\n</div>\r\n</div>\r\n<h2 style=\"clear: both; padding: 10px 0px 20px 0px;\">SPA-процедуры</h2>\r\n<div class=\"sa3 sa301\">\r\n<p><a href=\"/protsedury/bochka.html\"><img src=\"images/spa/spa_01.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Кедровая бочка</h3>\r\n<p class=\"min\">Оказывает благотворное воздействие на весь организм, улучшает состояние кожи и укрепляет иммунитет</p>\r\n<p class=\"cena\">от 900 ₽</p>\r\n<p><a href=\"/protsedury/bochka.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><a href=\"/protsedury/ekzo-massazh.html\"><img src=\"images/spa/attachment.png\" alt=\"attachment\" width=\"904\" height=\"168\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Экзомассаж</h3>\r\n<p class=\"min\">Методика избавления от спазмов, которая применяется при заболеваниях опорно-двигательного аппарата</p>\r\n<p class=\"cena\">от 1 500 ₽</p>\r\n<p><a href=\"/protsedury/ekzo-massazh.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><a href=\"/protsedury/klassicheskij-massazh.html\"><img src=\"images/spa/spa_03.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Классический массаж</h3>\r\n<p class=\"min\">Помогает расслабиться, избавиться от чувства скованности в суставах, отдохнуть после рабочего дня</p>\r\n<p class=\"cena\">от 3 000 ₽</p>\r\n<p><a href=\"/protsedury/klassicheskij-massazh.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa301\">\r\n<p><a href=\"/protsedury/limfodrenazhnyj-massazh.html\"><img src=\"images/spa/spa_04-0.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Лимфодренажный массаж</h3>\r\n<p class=\"min\">Позволяет восстановить нормальное движение лимфы, предотвратить застойные явления, отечность тканей</p>\r\n<p class=\"cena\">от 2 000 ₽</p>\r\n<p><a href=\"/protsedury/limfodrenazhnyj-massazh.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><a href=\"/protsedury/antitsellyulitnyj-massazh.html\"><img src=\"images/spa/spa_05-0.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Антицеллюлитный массаж</h3>\r\n<p class=\"min\">Активизирует кровообращение в проблемных зонах и запускает процесс сжигания жиров</p>\r\n<p class=\"cena\">от 2 000 ₽</p>\r\n<p><a href=\"/protsedury/antitsellyulitnyj-massazh.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><a href=\"/protsedury/vakuumnyj-massazh.html\"><img src=\"images/spa/spa_06-0.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Вакуумный массаж</h3>\r\n<p class=\"min\">Улучшает кровообращение, насыщает клетки кислородом, помогает избавиться от неровностей кожи</p>\r\n<p class=\"cena\">от 2 000 ₽</p>\r\n<p><a href=\"/protsedury/vakuumnyj-massazh.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa301\">\r\n<p><a href=\"/protsedury/medovyj-massazh.html\"><img src=\"images/spa/spa_07.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Медовый массаж</h3>\r\n<p class=\"min\">Улучшаут состояние кожи, питая ее и насыщая витаминами, избавляет от боли в суставах и мышцах</p>\r\n<p class=\"cena\">от 2 000 ₽</p>\r\n<p><a href=\"/protsedury/medovyj-massazh.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><a href=\"/protsedury/lpg.html\"><img src=\"images/spa/шок.jpg\" alt=\"шок\" width=\"926\" height=\"175\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Шоколадный массаж</h3>\r\n<p class=\"min\">Приятная и&nbsp;действенная процедура, направленная на восстановление эмоционального фона и снятие стресса.</p>\r\n<p class=\"cena\">от 3 700 ₽</p>\r\n<p><a href=\"/protsedury/lpg.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><a href=\"/protsedury/pressoteratiya.html\"><img src=\"images/spa/spa_09.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Прессотератия</h3>\r\n<p class=\"min\">Процедура помогает избавиться от лишнего веса и целлюлита, улучшить состояние кожи</p>\r\n<p class=\"cena\">от 1 200 ₽</p>\r\n<p><a href=\"/protsedury/pressoteratiya.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa301\">\r\n<p style=\"text-align: center;\"><img src=\"images/spa/spa_10.jpg\" alt=\"spa 10\" width=\"535\" height=\"143\" style=\"float: right;\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3 style=\"text-align: center;\">Лазерная эпиляция</h3>\r\n<p class=\"min\" style=\"text-align: center;\">Данный метод позволяет добиться гладкости кожи в любой зоне тела на длительное время</p>\r\n<p class=\"cena\" style=\"text-align: center;\">от 2 000 ₽</p>\r\n<p style=\"text-align: center;\"><a href=\"/protsedury/lazernaya-epilyatsiya.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><a href=\"/protsedury/stix.html\"><img src=\"images/spa/spa_11.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Обертывания \"Stix\"</h3>\r\n<p class=\"min\">Прямое воздействие на проблемные участки тела, мягкая и эффективная коррекция фигуры</p>\r\n<p class=\"cena\">от 2 500 ₽</p>\r\n<p><a href=\"/protsedury/stix.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><a href=\"/protsedury/renie.html\"><img src=\"images/spa/spa_12.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Липосакция \"Renie\"</h3>\r\n<p class=\"min\">Методика похудения, позволяющая избавиться от лишних сантиметров без строгих диет и спорта</p>\r\n<p class=\"cena\">от 2 500 ₽</p>\r\n<p><a href=\"/protsedury/renie.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>', 1, 'prod', 0, '0000-00-00 00:00:00', '2023-06-21 05:32:01', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
