(114, 110, 'Алтай', '', '<h2>Экскурсия по Алтаю</h2>\r\n<p>Предлагаем вам познакомиться с удивительной природой, побывать вдали от шумных городов, попробовать алтайский мед и натуральную косметическую продукцию.</p>\r\n<p class=\"zap-c\"><a href=\"#zak-kup\" class=\"more modalbox\">Запись на приём</a></p>', 1, 'ceny', 0, '0000-00-00 00:00:00', '2023-06-21 05:31:49', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(115, 111, 'Цены Spa-процедуры и программы все (главная) (2)', '', '<h2>SPA-программы</h2>\r\n<div class=\"sa3 sa301\" style=\"position: relative;\">\r\n<p><img src=\"images/spa/spa_0001.jpg\" alt=\"\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3>SPA Алтайское золото</h3>\r\n<p class=\"min\">Распаривание в кедровой арома-сауне (корень солодки, золотой корень, смородина, чабрец)</p>\r\n<p class=\"min\">Медово-солевой пилинг</p>\r\n<p class=\"min\">Массаж Абхьянга (умасливание тела)</p>\r\n<p class=\"min\">Обёртывание с целебными травам в молоке</p>\r\n<p class=\"min\">Чаепитие с Алтайскими травами и натуральным медом</p>\r\n<p class=\"min\">&nbsp;</p>\r\n<p class=\"min\">Время: 3 часа</p>\r\n<p class=\"cena\">5 700 ₽</p>\r\n<p><a href=\"#zak-kup\" class=\"more modalbox\">Записаться</a></p>\r\n</div>\r\n<p class=\"firm\">Фирменная программа</p>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><img src=\"images/spa/spa_0002.jpg\" alt=\"\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3>SPA Аромат леса</h3>\r\n<p class=\"min\">Распаривание в кедровой арома-сауне с сбором Алтайских трав (хвоя, хмель, пустырник и т.д)</p>\r\n<p class=\"min\">Пилинг тела с кедровым жмыхом и маслом</p>\r\n<p class=\"min\">Расслабляющий авторский массаж</p>\r\n<p class=\"min\">Чаепитие с Алтайскими травами и натуральным медом</p>\r\n<p class=\"min\">&nbsp;</p>\r\n<p class=\"min none\">&nbsp;</p>\r\n<p class=\"min\">Время: 2 часа</p>\r\n<p class=\"cena\">5 500 ₽</p>\r\n<p><a href=\"#zak-kup\" class=\"more modalbox\">Записаться</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><img src=\"images/spa/spa_0003.jpg\" alt=\"\" /></p>\r\n<div class=\"sa3vn\">\r\n<h3>SPA Таежное</h3>\r\n<p class=\"min\">Распаривание в арома-сауне с травяным сбором (зверобой, береза, бессмертник и т.д)</p>\r\n<p class=\"min\">Массаж спины с кедровым маслом</p>\r\n<p class=\"min\">Чаепитие с Алтайскими травами и натуральным медом</p>\r\n<p class=\"min\">&nbsp;</p>\r\n<p class=\"min none\">&nbsp;</p>\r\n<p class=\"min none\">&nbsp;</p>\r\n<p class=\"min\">Время: 1 час 40 минут</p>\r\n<p class=\"cena\">3 800 ₽</p>\r\n<p><a href=\"#zak-kup\" class=\"more modalbox\">Записаться</a></p>\r\n</div>\r\n</div>\r\n<h2 style=\"clear: both; padding: 10px 0px 20px 0px;\">SPA-процедуры</h2>\r\n<div class=\"sa3 sa301\">\r\n<div class=\"sa3vn\">\r\n<p style=\"text-align: center;\"><a href=\"/protsedury/lazernaya-epilyatsiya.html\" class=\"more\"></a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa302\">\r\n<p><a href=\"/protsedury/stix.html\"><img src=\"images/spa/spa_11.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Обертывания \"Stix\"</h3>\r\n<p class=\"min\">Прямое воздействие на проблемные участки тела, мягкая и эффективная коррекция фигуры</p>\r\n<p class=\"cena\">от 2 500 ₽</p>\r\n<p><a href=\"/protsedury/stix.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>\r\n<div class=\"sa3 sa303\">\r\n<p><a href=\"/protsedury/renie.html\"><img src=\"images/spa/spa_12.jpg\" alt=\"\" /></a></p>\r\n<div class=\"sa3vn\">\r\n<h3>Липосакция \"Renie\"</h3>\r\n<p class=\"min\">Методика похудения, позволяющая избавиться от лишних сантиметров без строгих диет и спорта</p>\r\n<p class=\"cena\">от 2 500 ₽</p>\r\n<p><a href=\"/protsedury/renie.html\" class=\"more\">Подробнее</a></p>\r\n</div>\r\n</div>', 1, 'prod', 0, '0000-00-00 00:00:00', '2023-06-21 05:32:01', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(116, 112, 'Каракольские', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/karakol600.jpg\" alt=\"ex\" /></p>\r\n<h3>Живописные Каракольские озёра</h3>\r\n<p class=\"cena\">28 950₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*указана цена билета на 1 человека, набор группы от 12 до 20 человек</p>\r\n<p class=\"desc\">Пролетим над каскадом Каракольских озер, состоящим из семи озер, расположенных на ступенях гигантской каровой лестницы, соединенных между собой притоком реки Каракол. Абсолютная высота самого верхнего из озер 1840 м.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждое воскресенье в 18:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-karakol\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-karakol\" style=\"display: none; width: 700px; cursor: auto;\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>17:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>18:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>18:35<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка на перевале Багаташ, на высоте около 2000 метров, откуда открывается потрясающий вид на каскад из семи Каракольских озер и окружающую красоту Алтая.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>19:05<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет Карасук.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>19:35<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зависимости от погодных условий и времени сбора группы.</p>\r\n\r\n</div>', 1, 'ex01', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(117, 113, 'Белуха', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/beluha600.jpg\" alt=\"ex\" /></p>\r\n<h3>Священная гора Алтая Белуха</h3>\r\n<p class=\"cena\">76 500₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*указана цена билета на 1 человека, набор группы от 12 до 20 человек</p>\r\n<p class=\"desc\">Посетим одну из самых красивых гор Алтая, высшую точку Катунского хребта (4506 м), священное место всех алтайцев, рядом с которым, по поверьям, находится вход в легендарную страну Шамбалу.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждую субботу в 9:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-beluha\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-beluha\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>8:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>9:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вы увидите невероятной красоты горы и долину реки Катунь.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>10:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка на озере Аккем у подножья г. Белухи. Во время часовой стоянки вас ждёт экскурсия с гидом в окрестностях озера Аккем, невероятно красивые виды священной горы Алтая Белухи и ее окрестностей, чистейший горный воздух и незабываемые впечатления.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>11:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время обратного полета вы будете пересекать Чуйский тракт, одну из красивейших дорог мира и увидите живописные пейзажи долины реки Катунь.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>13:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зависимости от погодных условий и времени сбора группы.</p>\r\n\r\n</div>', 1, 'ex02', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(118, 114, 'Телецкое', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/chul600.jpg\" alt=\"ex\" /></p>\r\n<h3>Жемчужина Алтая Телецкое озеро и долина реки Чулышман</h3>\r\n<p class=\"cena\">79 900₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*указана цена билета на 1 человека, набор группы от 12 до 20 человек</p>\r\n<p class=\"desc\">Полет над акваторией Телецкого озера и долиной реки Чулышман, над водопадами, горными вершинами, многочисленными реками, впадающими в Алтын-Кёль.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждое воскресенье в 9:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-telec\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-telec\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>8:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>9:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>10:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в долине реки Чулышман, у живописного водопада Куркуре. Во время часовой стоянки наш гид проведёт для Вас увлекательную экскурсию.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>11:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет в село Иогач. Пролетим через всю долину Чулышмана где вы увидите урочище «каменных грибов», далее над акваторией озера Телецкого до села Иогач где совершим посадку для непродолжительной стоянки (время стоянки 30 минут).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>12:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в с. Иогач.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>12:40<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет Карасук.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>13:20<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зависимости от погодных условий и времени сбора группы.</p>\r\n\r\n</div>', 1, 'ex03', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*');
INSERT INTO `jm_modules` (`id`, `asset_id`, `title`, `note`, `content`, `ordering`, `position`, `checked_out`, `checked_out_time`, `publish_up`, `publish_down`, `published`, `module`, `access`, `showtitle`, `params`, `client_id`, `language`) VALUES
(119, 115, 'Золотое кольцо', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/telec600.jpg\" alt=\"ex\" /></p>\r\n<h3>«Золотое кольцо» Увидеть весь Алтай за один день</h3>\r\n<p class=\"cena\">129 900₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*указана цена билета на 1 человека, набор группы от 12 до 20 человек</p>\r\n<p class=\"desc\">Золотое кольцо Алтая - За один день вы увидите самые красивые места Алтая. Самую высокую вершину Сибири, гору Белуха и жемчужину Алтая озеро Телецкое.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждую пятницу в 9:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-gold\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-gold\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>8:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>9:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вы увидите невероятной красоты горы и долину реки Катунь.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>10:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка на озере Аккем у подножья г. Белухи. Во время часовой стоянки Вас ждёт экскурсия с гидом в окрестностях озера Аккем, невероятно красивые виды священной горы Алтая Белухи и ее окрестностей, чистейший горный воздух и незабываемые впечатления.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>11:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вам откроются красивейшие горные пейзажи Республики Алтай.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>12:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в Тюнгуре для вкусного обеда.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>13:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет в долину Чулышмана.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>14:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в долине реки Чулышман у живописного водопада Куркуре. Во время часовой стоянки наш гид проведёт для вас увлекательную экскурсию.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>15:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет в село Иогач. Пролетим через всю долину Чулышмана где вы увидите урочище «каменных грибов», далее над акваторией озера Телецкого до села Иогач где совершим посадку для непродолжительной стоянки (время стоянки 30 минут).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>16:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в с. Иогач.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>16:40<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет Карасук.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>17:20<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зависимости от погодных условий и времени сбора группы.</p>\r\n</div>', 1, 'ex04', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(120, 116, 'Стоимость old', '', '<h2>Стоимость</h2>\r\n<div class=\"productwrap\">\r\n\r\n\r\n<div class=\"product pr01\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/1.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Орех тигровый сухой</p>\r\n</div>\r\n<div class=\"pr-gram\">\r\n<p>фасовка до 25 кг</p>\r\n</div>\r\n<div class=\"pr-cena\">\r\n<p>490 RUB за 1 кг</p>\r\n</div>\r\n<div class=\"pr-zak\">\r\n<p><a href=\"#\" class=\"more modalbox\"><img src=\"/images/ico_card.png\" alt=\"\" />Заказать</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"product pr02\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/1.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Орех тигровый сухой</p>\r\n</div>\r\n<div class=\"pr-gram\">\r\n<p>от 25 до 300 кг</p>\r\n</div>\r\n<div class=\"pr-cena\">\r\n<p>465 RUB за 1 кг</p>\r\n</div>\r\n<div class=\"pr-zak\">\r\n<p><a href=\"#\" class=\"more modalbox\"><img src=\"/images/ico_card.png\" alt=\"\" />Заказать</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"product pr03\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/1.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Орех тигровый сухой</p>\r\n</div>\r\n<div class=\"pr-gram\">\r\n<p>от 300 до 500 кг</p>\r\n</div>\r\n<div class=\"pr-cena\">\r\n<p>440 RUB за 1 кг</p>\r\n</div>\r\n<div class=\"pr-zak\">\r\n<p><a href=\"#\" class=\"more modalbox\"><img src=\"/images/ico_card.png\" alt=\"\" />Заказать</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n\r\n<div class=\"product pr04\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/1.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Орех тигровый сухой</p>\r\n</div>\r\n<div class=\"pr-gram\">\r\n<p>от 500 кг</p>\r\n</div>\r\n<div class=\"pr-cena\">\r\n<p>420 RUB за 1 кг</p>\r\n</div>\r\n<div class=\"pr-zak\">\r\n<p><a href=\"#\" class=\"more modalbox\"><img src=\"/images/ico_card.png\" alt=\"\" />Заказать</a></p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>', 1, 'kak', 0, '0000-00-00 00:00:00', '2025-03-09 06:56:16', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(121, 117, 'Доставка', '', '<h2>Доставка и оплата</h2>\r\n<h3>Доставка</h3>\r\n<ol>\r\n<li><p><strong>Транспортной компанией ПЭК.</strong> </p>\r\n<p>По предоплате за заказ. Доставка оплачивается сразу или при получении.</p>\r\n<div class=\"dost\">\r\n<iframe src=\"https://calc.pecom.ru/iframe/calculator/?intake=0&department-from-uid=f72699e3-677a-11ee-80d0-00155d66894c&address-to=Россия, Санкт-Петербург&delivery=1&weight=1&volume=0.01&maxDimension=0.1&declared-amount=100&packing-rigid=0&transportation-type=auto&address-from-block=1&dimensions-block=0&sender-legalform=1&sender-country=RU&sender-inn-passnum=&sender-person-surname=&sender-person-name=&sender-phone=\" width=\"900\" height=\"600\" frameborder=\"0\"></iframe>\r\n</div>\r\n<div class=\"dost-mob\">\r\n<iframe src=\"https://calc.pecom.ru/iframe/calculator/?intake=0&department-from-uid=f72699e3-677a-11ee-80d0-00155d66894c&address-to=Россия, Санкт-Петербург&delivery=1&weight=1&volume=0.01&maxDimension=0.1&declared-amount=100&packing-rigid=0&transportation-type=auto&address-from-block=1&dimensions-block=0&sender-legalform=1&sender-country=RU&sender-inn-passnum=&sender-person-surname=&sender-person-name=&sender-phone=\" width=\"320\" height=\"600\" frameborder=\"0\"></iframe>\r\n</div>\r\n\r\n</li>\r\n<li><p><strong>Транспортной компанией CDEK. </strong></p>\r\n<p>По предоплате за заказ. Доставка оплачивается сразу или при получении.</p></li>\r\n<li><p><strong>Почтой РФ. </strong></p>\r\n<p>Посылками до 15 кг. По предоплате за заказ и доставку.</p></li>\r\n</ol>\r\n\r\n<h3>Оплата</h3>\r\n<ol>\r\n<li><p><strong>Оплата покупок банковской картой</strong></p>\r\n<p>Вы можете совершить предоплату заказа с банковских карт Visa, MasterCard или МИР.</p>\r\n<p>После оформления заказа, мы вам отправляем уведомление с реквизитами для оплаты. Оплата производится через платежную страницу банка Тинькофф и Альфабанк. Вам необходимо ввести все необходимые данные и произвести оплату после оформления заказа. Вводимая Вами информация недоступна посторонним лицам. Комиссия за оплату не взимается.</p></li>\r\n<li>\r\n<p><strong>Оплата по QR коду (СБП)</strong></p>\r\n<p>После оформления заказа, мы вам отправляем уведомление с QR-кодом. Оплата производится через платежную страницу банка Тинькофф, Вам необходимо перейти в онлайн-банк Вашего банка и произвести оплату по QR коду (СБП-система быстрых платежей). Вводимая Вами информация недоступна посторонним лицам. Комиссия за оплату не взимается.</p></li>\r\n<li>\r\n<p><strong>Безналичное перечисление денежных средств</strong></p>\r\n<p>После оформления заказа, мы вам отправляем уведомление с реквизитами и вложенной квитанцией или счетом (для юр.лиц). Вы оплачиваете заказ в любом банке по квитанции.</p></li>\r\n</ol>\r\n<h3>Порядок возврата денежных средств</h3>\r\n\r\n<p>Для полного или частичного возврата денежных средств на карту Вам необходимо обратиться к менеджеру по телефону <a href=\"tel:+79001894912\">+7(900)1894912</a> или отправив письмо на почту <a href=\"mailto:tiger-fish22@mail.ru\">tiger-fish22@mail.ru</a>. Деньги автоматически вернутся на вашу карту в течение 1-3х дней. Точный срок возврата денежных средств зависит от давности размещения заказа и от банка, выпустившего карту (максимальный срок возврата не может превышать 30 дней).</p>', 1, 'spo', 0, '0000-00-00 00:00:00', '2025-03-09 06:56:16', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(122, 118, 'О компании', '', '<h2>О компании</h2>\r\n<p>Вертолётные экскусрии осуществляет компания «АлтайАвиа» - одна из самых крупных частных авиакомпаний в Сибири. Все полеты проводят профессиональные пилоты на современных вертолетах.</p>\r\n<p>Уникальные маршруты разработанные нашей компанией, включающие полёты над живописной территорией Республики Алтай, покорят ваше сердце восхитительной красотой алтайской природы.</p>\r\n<p>Мы гарантируем полную безопасность пассажиров с момента взлёта до приземления.</p>\r\n<div class=\"img01\"><img src=\"images/karasuk/k00.jpg\" alt=\"\" /></div>\r\n<div class=\"img01\"><img src=\"images/karasuk/k02.jpg\" alt=\"\" /></div>', 1, 'prod', 0, '0000-00-00 00:00:00', '2025-03-09 06:55:59', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(123, 119, 'Заявка', 'ЗАХОДИТЬ БЕЗ РЕДАКТОРА!!!', '<div class=\"zakaz-txt\">\r\n<h2>Будьте в числе наших клиентов</h2>\r\n<p class=\"min\">Оставьте заявку и мы свяжемся с Вами.</p>\r\n</div>\r\n\r\n<div class=\"zakaz-form\">\r\n<div id=\"zak-contakt\">\r\n<div id=\"result_client\">\r\n<form action=\"#\" autocomplete=\"off\" method=\"post\" name=\"contact\" id=\"form_client\">\r\n<div class=\"radio_buttons\">\r\n                           <div class=\"blok2ltxt\">\r\n                                <input name=\"spec\" type=\"radio\" id=\"radiogv2\" value=\"Получить прайс-лист\" checked>\r\n                                <label for=\"radiogv2\">Получить прайс-лист</label>\r\n                            </div>    \r\n                            <div class=\"blok2rtxt\">\r\n                            <input name=\"spec\" type=\"radio\" id=\"radiogv1\" value=\"Начать сотрудничество\">\r\n                                <label for=\"radiogv1\">Начать сотрудничество</label>\r\n                            </div>\r\n</div><!--radio_buttons-->\r\n<div class=\"fo100\">\r\n<input name=\"fio\" required=\"\" type=\"text\" class=\"txt\" id=\"fio_client\" placeholder=\"ФИО\" />\r\n<div id=\"fio_client_err\"></div>\r\n</div>\r\n<div class=\"fo2 foleft\"><input name=\"tel\" required=\"\" type=\"tel\" class=\"txt telephone\" id=\"tel_client\" placeholder=\"Телефон\" /> <div id=\"tel_client_err\"></div></div>\r\n<div class=\"fo2 forig\"><input name=\"mail\" required=\"\" type=\"email\" class=\"txt\"  id=\"mail_client\" placeholder=\"Почта\" /> <div id=\"mail_client_err\"></div></div>\r\n<input name=\"form\" type=\"hidden\" value=\"client\" />\r\n<div class=\"fo100\">\r\n<p class=\"min2\">Отправляя заявку вы даёте согласие на обработку персональных данных в соответствии с <a href=\"/images/politika.pdf\">Условиями</a></p>\r\n<input class=\"send\" id=\"btn_client\" type=\"button\" value=\"Отправить заявку\">\r\n</div>\r\n</form>\r\n</div>\r\n</div>\r\n</div>\r\n', 1, 'zakaz', 0, '0000