(124, 120, 'Каракольские (2)', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/karakol600.jpg\" alt=\"ex\" /></p>\r\n<h3>Живописные Каракольские озёра</h3>\r\n<p class=\"cena\">12 100₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*цена зависит от количества человек в группе</p>\r\n<p class=\"desc\">Пролетим над каскадом Каракольских озер, состоящим из семи озер, расположенных на ступенях гигантской каровой лестницы, соединенных между собой притоком реки Каракол. Абсолютная высота самого верхнего из озер 1840 м.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждое воскресенье в 18:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-karakol\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-karakol\" style=\"display: none; width: 700px; cursor: auto;\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>17:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>18:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>18:35<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка на перевале Багаташ, на высоте около 2000 метров, откуда открывается потрясающий вид на каскад из семи Каракольских озер и окружающую красоту Алтая.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>19:05<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет Карасук.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>19:35<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зави