(125, 121, 'Белуха (2)', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/beluha600.jpg\" alt=\"ex\" /></p>\r\n<h3>Священная гора Алтая Белуха</h3>\r\n<p class=\"cena\">34 200₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*цена зависит от количества человек в группе</p>\r\n<p class=\"desc\">Посетим одну из самых красивых гор Алтая, высшую точку Катунского хребта (4506 м), священное место всех алтайцев, рядом с которым, по поверьям, находится вход в легендарную страну Шамбалу.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждую субботу в 9:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-beluha\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-beluha\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>8:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>9:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вы увидите невероятной красоты горы и долину реки Катунь.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>10:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка на озере Аккем у подножья г. Белухи. Во время часовой стоянки вас ждёт экскурсия с гидом в окрестностях озера Аккем, невероятно красивые виды священной горы Алтая Белухи и ее окрестностей, чистейший горный воздух и незабываемые впечатления.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>11:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вам откроются красивейшие горные пейзажи Республики Алтай.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>12:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в Тюнгуре, остановка для вкусного обеда.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>13:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время обратного полета вы будете пересекать Чуйский тракт, одну из красивейших дорог мира и увидите живописные пейзажи долины реки Катунь.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>14:20<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зависимости от погодных условий и времени сбора группы.</p>\r\n<h3 style=\"padding: 20px 0;\">Стоимость</h3>\r\n<table class=\"group\" style=\"width: 100%;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"nonl\">\r\n<p class=\"tab1\">Кол-во<br />человек<br />в группе</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">19</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">18</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">17</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">16</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">15</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">14</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">13</p>\r\n</td>\r\n<td class=\"nonr\">\r\n<p class=\"blue\">12</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"nonl nonbot\">\r\n<p class=\"tab1\">Цена<br />за 1 чел,<br />руб.</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>34&nbsp;200</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>36&nbsp;100</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>38&nbsp;200</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>40&nbsp;600</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>43&nbsp;300</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>46&nbsp;400</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>50&nbsp;000</p>\r\n</td>\r\n<td class=\"nonbot nonr\">\r\n<p>54&nbsp;200</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 1, 'ex02', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"ba