(126, 122, 'Телецкое (2)', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/chul600.jpg\" alt=\"ex\" /></p>\r\n<h3>Жемчужина Алтая Телецкое озеро и долина реки Чулышман</h3>\r\n<p class=\"cena\">34 200₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*цена зависит от количества человек в группе</p>\r\n<p class=\"desc\">Полет над акваторией Телецкого озера и долиной реки Чулышман, над водопадами, горными вершинами, многочисленными реками, впадающими в Алтын-Кёль.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждое воскресенье в 9:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-telec\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-telec\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>8:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>9:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>10:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в долине реки Чулышман, у живописного водопада Куркуре. Во время часовой стоянки наш гид проведёт для Вас увлекательную экскурсию.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>11:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет в село Иогач. Пролетим через всю долину Чулышмана где вы увидите урочище «каменных грибов», далее над акваторией озера Телецкого до села Иогач где совершим посадку для непродолжительной стоянки (время стоянки 30 минут).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>12:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в с. Иогач.</p>\r\n</