(127, 123, 'Золотое кольцо (2)', '', '<div class=\"ex-wrap\">\r\n<p><img src=\"images/ex/telec600.jpg\" alt=\"ex\" /></p>\r\n<h3>«Золотое кольцо» Увидеть весь Алтай за один день</h3>\r\n<p class=\"cena\">56 500₽<sup>*</sup></p>\r\n<p class=\"cena-min\">*цена зависит от количества человек в группе</p>\r\n<p class=\"desc\">Золотое кольцо Алтая - За один день вы увидите самые красивые места Алтая. Самую высокую вершину Сибири, гору Белуха и жемчужину Алтая озеро Телецкое.</p>\r\n<p class=\"time\">Полёты осуществляются еженедельно каждую пятницу в 9:00</p>\r\n<div class=\"mo1\">\r\n<p><a href=\"#ex-gold\" class=\"more\" data-fancybox>Программа полёта</a></p>\r\n</div>\r\n<div class=\"mo2\">\r\n<p><a href=\"#zayavka1\" class=\"more2\">Забронировать</a></p>\r\n</div>\r\n</div>\r\n<div id=\"ex-gold\">\r\n<h2>Программа полёта</h2>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>8:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Сбор группы на посадочной площадке Карасук (Чемальский р-н, с. Чепош).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>9:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вы увидите невероятной красоты горы и долину реки Катунь.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>10:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка на озере Аккем у подножья г. Белухи. Во время часовой стоянки Вас ждёт экскурсия с гидом в окрестностях озера Аккем, невероятно красивые виды священной горы Алтая Белухи и ее окрестностей, чистейший горный воздух и незабываемые впечатления.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>11:30<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет. Во время полета вам откроются красивейшие горные пейзажи Республики Алтай.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>12:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в Тюнгуре для вкусного обеда.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>13:00<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет в долину Чулышмана.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>14:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в долине реки Чулышман у живописного водопада Куркуре. Во время часовой стоянки наш гид проведёт для вас увлекательную экскурсию.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog nons\">\r\n<div class=\"times\">\r\n<p>15:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет в село Иогач. Пролетим через всю долину Чулышмана где вы увидите урочище «каменных грибов», далее над акваторией озера Телецкого до села Иогач где совершим посадку для непродолжительной стоянки (время стоянки 30 минут).</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>16:10<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка в с. Иогач.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>16:40<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Вылет Карасук.</p>\r\n</div>\r\n</div>\r\n<div class=\"prog\">\r\n<div class=\"times\">\r\n<p>17:20<sup>*</sup></p>\r\n</div>\r\n<div class=\"descr\">\r\n<p>Посадка Карасук, окончание экскурсии.</p>\r\n</div>\r\n</div>\r\n<p class=\"min-ex\">*время может меняться в зависимости от погодных условий и времени сбора группы.</p>\r\n<h3 style=\"padding: 20px 0;\">Стоимость</h3>\r\n<table class=\"group\" style=\"width: 100%;\">\r\n<tbody>\r\n<tr>\r\n<td class=\"nonl\">\r\n<p class=\"tab1\">Кол-во<br />человек<br />в группе</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">19</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">18</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">17</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">16</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">15</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">14</p>\r\n</td>\r\n<td>\r\n<p class=\"blue\">13</p>\r\n</td>\r\n<td class=\"nonr\">\r\n<p class=\"blue\">12</p>\r\n</td>\r\n</tr>\r\n<tr>\r\n<td class=\"nonl nonbot\">\r\n<p class=\"tab1\">Цена<br />за 1 чел,<br />руб.</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>56&nbsp;500</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>59&nbsp;600</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>63&nbsp;100</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>67&nbsp;100</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>71&nbsp;500</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>76&nbsp;650</p>\r\n</td>\r\n<td class=\"nonbot\">\r\n<p>82&nbsp;500</p>\r\n</td>\r\n<td class=\"nonbot nonr\">\r\n<p>89&nbsp;400</p>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>', 1, 'ex04', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(128, 124, 'На чем летаем (2)', '', '<div class=\"mi8\"><img src=\"images/mi8-2023.jpg\" alt=\"\" /></div>\r\n<div class=\"mitext\">\r\n<p>Наши групповые полёты совершаются на вертолётах типа Ми-8АМТ.</p>\r\n<p>Также в авиакомпании «АлтайАвиа» имеются другие типы вертолётов: Robinson R66, Eurocopter AS350, МИ-8МТВ - для туристических целей, деловых поездок, отдыха или чтобы попасть в непроходимое место.</p>\r\n<p><a href=\"https://altay-avia.ru/\" class=\"more3\">Подробнее</a></p>\r\n</div>', 1, 'spo', 0, '0000-00-00 00:00:00', '2024-03-26 07:24:17', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(129, 125, 'Протокол', '', '<h2>Протокол качества</h2>\r\n<p>Для тигрового ореха проведены все необходимые испытания по определению качества и безопасности!</p>\r\n<p class=\"downl\"><a href=\"/images/doc/protokol2024.pdf\" target=\"_blank\"><i class=\"fa fa-file-pdf-o\" aria-hidden=\"true\"></i> Скачать протокол PDF</a></p>', 1, 'sert', 0, '0000-00-00 00:00:00', '2025-03-13 02:45:53', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(130, 126, 'Отзывы', '', '<h2>Отзывы рыбаков</h2>\r\n<div class=\"productwrap\">\r\n\r\n\r\n<div class=\"product pr01\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/otz/02.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Купил этот тигровый орех для ловли карпа, и я просто в восторге! Он очень прочный и надежный, что особенно важно при ловле крупной рыбы. Из-за своей текстуры и формы, он отлично держится на крючке и привлекает внимание рыбы. Несколько раз использовал его и каждый раз удавалось поймать больше карпа, чем раньше.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"product pr02\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/otz/03.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Разловили вчера орешки. Первый карпик взял именно на тигровый орешек, кстати самый крупный за всю рыбалку ~2800гр. Добавляем в прикорм молотый, а насадочный сверлим и вставляем пенопласт внутрь. Будем продолжать экспериментировать.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n<div class=\"product pr03\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/otz/05.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Время от времени на метод  весной, летом, осенью ставлю на волос тигровый орех. С попапом и без. Результатом доволен, рекомендую попробовать порыбачить на тигровый орех всем любителям рыбалки.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n\r\n<div class=\"product pr04\">\r\n<div class=\"prodvn\">\r\n<div class=\"pr-img\">\r\n<img src=\"/images/otz/06.jpg\" alt=\"\" />\r\n</div>\r\n<div class=\"pr-name\">\r\n<p>Не особо верил я в тигровый орех, смотря на массовый пиар. На этих выходных попробовал и был приятно удивлён, когда бойла молчали, рыба брала уверенно на орех. Всем рекомендую и сам буду пробовать еще.</p>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n</div>', 1, 'kak', 0, '0000-00-00 00:00:00', '2025-03-13 02:45:53', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
