(138, 139, 'Главная блоки ', '', '<h2>Крупы с алтайских полей от поля до прилавка</h2>\r\n<div class=\"mains\">\r\n<div class=\"mainfoto-left\"><img src=\"images/main/pole1.jpg\" alt=\"\" /></div>\r\n<div class=\"maintext-right\">\r\n<h3>Выращиваем чечевицу на собственных полях в Алтайском крае</h3>\r\n<p>Поля АПК – это земля в Алтайском крае, удаленная от магистральных дорог и промышленного производства. Идеальное место для выращивания зерновых культур.</p>\r\n</div>\r\n</div>\r\n<div class=\"mains\">\r\n<div class=\"mainfoto-left mobs\"><img src=\"images/main/pole2.jpg\" alt=\"\" /></div>\r\n<div class=\"maintext-left\">\r\n<h3>Производим продукцию, которой гордимся</h3>\r\n<p>Строгий контроль производственных процессов согласно ГОСТ 7066-2019. Качество готовой продукции подтверждено протоколами качества и декларацией о соответствии.</p>\r\n</div>\r\n<div class=\"mainfoto-right\"><img src=\"images/main/pole2.jpg\" alt=\"\" /></div>\r\n</div>\r\n<div class=\"mains\">\r\n<div class=\"mainfoto-left\"><img src=\"images/main/pole3.jpg\" alt=\"\" /></div>\r\n<div class=\"maintext-right\">\r\n<h3>Реализуем крупу собственного производства</h3>\r\n<p>Наша продукция представлена на прилавках в магазинах Сибири и на макркетплейсах.</p>\r\n</div>\r\n</div>', 1, 'spo', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(139, 140, 'Заявка на книгу рецептов', 'ЗАХОДИТЬ БЕЗ РЕДАКТОРА!!!', '<h2>Книга рецептов в подарок</h2>\r\n<div id=\"zak-kniga\">\r\n<div id=\"result_book\">\r\n<form action=\"#\" autocomplete=\"off\" method=\"post\" name=\"contactbook\" id=\"form_book\">\r\n\r\n<p class=\"min-kniga\">Заполните данные</p>\r\n<div class=\"fo2\"><input name=\"mail\" required=\"\" type=\"email\" class=\"txt\"  id=\"mail_book\" placeholder=\"Почта\" /> <div id=\"mail_book_err\"></div></div>\r\n<input name=\"form\" type=\"hidden\" value=\"book\" />\r\n<div class=\"fo100\">\r\n<p class=\"min2\">Отправляя заявку вы даёте согласие на обработку персональных данных в соответствии с <a href=\"/images/politika.pdf\">Условиями</a></p>\r\n<input class=\"send\" id=\"btn_book\" type=\"button\" value=\"Отправить заявку\">\r\n</form>\r\n</div>\r\n</div>\r\n</div>\r\n\r\n\r\n\r\n', 1, 'kak', 0, '0000-00-00 00:00:00', '2025-03-09 07:03:08', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
