(151, 154, 'О заводе', '', '<p>Завод был основан в 1935 г. Первоначально это было примитивное хозяйство, основанное на ручном труде, но уже в 1958 году в связи с ростом темпов строительства и увеличением потребности в строительных материалах, на месте примитивного хозяйства был запущен новый завод круглогодичного действия, мощностью 4 млн. штук кирпича в год. На 1980-90е гг. пришелся основной этап реконструкции завода.</p>\r\n\r\n\r\n<p>Мы гордимся нашим качественным продуктом и стремимся предоставить вам только лучшие материалы для ваших строительных нужд. Наша команда профессионалов всегда готова помочь вам выбрать подходящие материалы и ответить на все ваши вопросы. Обращайтесь к нам и создавайте надежные и долговечные строительные конструкции с нашими материалами высокого качества.</p>', 1, 'spo', 0, '0000-00-00 00:00:00', '2025-06-21 06:37:32', '0000-00-00 00:00:00', -2, 'mod_custom', 1, 0, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
