(160, 170, 'Кирпич (продукт)', '', '<a href=\"http://msdoroxy.beget.tech/brickm100.html\">\r\n            <div class=\"prod_vn\">\r\n                <div class=\"prodimg\"><p><img src=\"/images/main/img01.png\" alt=\"\"></p></div>\r\n                <h2>Кирпич</h2>\r\n                <p class=\"mins\">(М100)</p>\r\n                <p class=\"desc\">Все наши кирпичи изготавливаются из высококачественных материалов, что гарантирует их прочность и долговечность.</p>\r\n            </div>\r\n</a>', 1, 'prod', 98, '2025-10-24 07:43:46', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(161, 171, 'Телефоны подвал', '', '<div class=\"logobtext\">\r\n<p class=\"big\">ООО «Торговый Дом Ребрихинский Кирпичный Завод»</p>\r\n<p>ИНН: 2266005917 КПП:226601001</p>\r\n<p>658540, Алтайский край, Ребрихинский район, с. Ребриха, ул. Заводская, 1Б</p>\r\n</div>\r\n<div class=\"botphone\">\r\n<div class=\"twa\">\r\n<p><a href=\"https://api.whatsapp.com/send/?phone=79236474033\" title=\"WhatsApp\"><i class=\"fa fa-whatsapp\" aria-hidden=\"true\"></i>WhatsApp</a></p>\r\n</div>\r\n<p><a href=\"tel:+79039923585\"><span>+7-923-647-4033</span></a></p>\r\n</div>', 1, 'logob', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*'),
(162, 172, 'О заводе', '', '<div class=\"ozav01\">\r\n<h2>О заводе</h2>\r\n<p>Мы гордимся нашим качественным продуктом и стремимся предоставить вам только лучшие материалы для ваших строительных нужд. Наша команда профессионалов всегда готова помочь вам выбрать подходящие материалы и ответить на все ваши вопросы.</p>\r\n<p>Обращайтесь к нам и создавайте надежные и долговечные строительные конструкции с материалами отличного качества от ТД РКЗ.</p>\r\n</div>\r\n<div class=\"ozav02\">\r\n<p><img src=\"images/zavod.jpg\" alt=\"\" /></p>\r\n</div>', 1, 'okomp', 0, '0000-00-00 00:00:00', '0000-00-00 00:00:00', '0000-00-00 00:00:00', 1, 'mod_custom', 1, 1, '{\"prepare_content\":0,\"backgroundimage\":\"\",\"layout\":\"_:default\",\"moduleclass_sfx\":\"\",\"cache\":1,\"cache_time\":900,\"cachemode\":\"static\",\"module_tag\":\"div\",\"bootstrap_size\":\"0\",\"header_tag\":\"h3\",\"header_class\":\"\",\"style\":\"0\"}', 0, '*');
